import React, { Component } from "react";

export class Practiece extends Component {
  constructor(props) {
    super(props);

    this.state = {};
  }

  render() {
    return (
      <div
        style={{
          display: "flex",
          width: "800px",
          flexWrap: "wrap",
          flexDirection: "row"
        }}
      ></div>
    );
  }
}

export default Practiece;
